CREATE TABLE store (
    CITY VARCHAR(64),
    POSTAL_CODE VARCHAR(32),
    STREET VARCHAR(32),
    STREET2 VARCHAR(32),
    STREET3 VARCHAR(32),
    ADDRESS_NAME VARCHAR(512),
    UUID VARCHAR(128),
    LONGITUDE VARCHAR(32),
    LATITUDE VARCHAR(32),
    COMPLEX_NUMBER VARCHAR(32),
    SHOW_WARNING_MESSAGE BOOLEAN,
    TODAY_OPEN VARCHAR(32),
    LOCATION_TYPE VARCHAR(32),
    COLLECTION_POINT BOOLEAN,
    SAP_STOREID VARCHAR(32),
    TODAY_CLOSE VARCHAR(32)
);

